import UseContextComponent from "./components/use(Context)";
import UsePromiseComponent from "./components/use(Promise)";
import UseFormStateComponent from "./components/useFormState";

const App = () => {
    return (
        <>
        {/* NOTE : use(Promise)  */}
        <UsePromiseComponent />
        <BorderBox/>
        {/* NOTE : use(Context)  */}
        <UseContextComponent />
        <BorderBox/>
        {/* NOTE : useFormState */}
        <UseFormStateComponent />
        </>
    )
}

const BorderBox = () => {
    return (
        <div style={{ height: `2px`, backgroundColor: `gray`, margin: '0p20px' }}></div>
    )
}

export default App;
